function CountLetter(text) {
  const map = new Map();
  var arr = text.split(' ');
  for(i=0;i<arr.length;i++){
    var string = arr[i];
    if(string in map) {
        map[string] = map[string]+1;
    }
    else{
        map[string] = 1;
    }
  }

  var maxString;
  var maxCount = 0;
  for(var i in map){
      var key = i;
      var val = map[i];
      if(val > maxCount){
          maxString = key;
          maxCount = val;
      }
  }

  let firstele = maxString;
  let secondele = maxCount;
  return {firstele, secondele};

}
